import React from "react";
import Ul_li from "./Ul_Li";

function List() {
  return (
    <ul className="list-group">
        {/* <img src=""/> */}
      <Ul_li id="feacbook" text="Feacbook" for="for-Feacbook"
       img="https://th.bing.com/th/id/OIP.cKHDn5BVTmJzY-yNL4nLQAHaFf?w=216&h=180&c=7&r=0&o=5&pid=1.7" />
      <Ul_li id="youtub" text="Youtub" for="for-Youtub" 
      img="https://th.bing.com/th/id/OIP.P6WL3XxOPGhdEko7yoGbbQHaFj?w=213&h=180&c=7&r=0&o=5&pid=1.7" />
      <Ul_li id="telegram" text="Telegram" for="for-telegram" img='https://th.bing.com/th/id/OIP.8NYDtbLqraAquonpU0qb8QHaFj?w=206&h=180&c=7&r=0&o=5&pid=1.7' />
      <Ul_li id="whatsapp" text="Whatsapp" img='https://th.bing.com/th/id/OIP.8NYDtbLqraAquonpU0qb8QHaFj?w=206&h=180&c=7&r=0&o=5&pid=1.7' />

    </ul>
  );
}
export default List;
